import React from "react";
import SingleContact from "./components/SingleContact";

const ContactList = ({ allContacts }) => {
  return (
    <div>
      {allContacts.map((data, index) => (
        <SingleContact />
      ))}
    </div>
  );
};

export default ContactList;
